// Generated.js
import React, { useState } from 'react';
import axios from 'axios';

const Generated = () => {
  const [hours, setHours] = useState('');
  const [data, setData] = useState([]);

  const handleGenerateData = async () => {
    try {
      const response = await axios.post('http://localhost:3001/generateData', { hours });
      setData(response.data);
    } catch (error) {
      console.error('Error generating data:', error);
    }
  };

  return (
    <div>
      <h2>Generate Data</h2>
      <div>
        <label>
          Number of Hours:
          <input type="number" value={hours} onChange={(e) => setHours(e.target.value)} />
        </label>
      </div>
      <button onClick={handleGenerateData}>Generate Data</button>
      {data.length > 0 && (
        <div>
          <h3>Generated Data:</h3>
          <ul>
            {data.map((entry, index) => (
              <li key={index}>
                ID: {entry.id}, Timestamp: {entry.ts}, Machine Status: {entry.machine_status}, Vibration: {entry.vibration}
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default Generated;
